package com.tianyi.helmet.server.vo.maillist;public class ContactVo {    private String helmetFriend;    private String contactName;    private String tianYiUser;    private String contactPhone;    private String contactCompany;    private String contactDepartment;    public String isHelmetFriend() {        return helmetFriend;    }    public void setHelmetFriend(String helmetFriend) {        this.helmetFriend = helmetFriend;    }    public String getContactName() {        return contactName;    }    public void setContactName(String contactName) {        this.contactName = contactName;    }    public String isTianYiUser() {        return tianYiUser;    }    public void setTianYiUser(String tianYiUser) {        this.tianYiUser = tianYiUser;    }    public String getContactPhone() {        return contactPhone;    }    public void setContactPhone(String contactPhone) {        this.contactPhone = contactPhone;    }    public String getContactCompany() {        return contactCompany;    }    public void setContactCompany(String contactCompany) {        this.contactCompany = contactCompany;    }    public String getContactDepartment() {        return contactDepartment;    }    public void setContactDepartment(String contactDepartment) {        this.contactDepartment = contactDepartment;    }}